import Meta from './Meta';
import Header from './Header';
import styled from '@emotion/styled';

const Global = styled.div`
  font-family: Arial, Helvetica, sans-serif;
  background-color: honeydew;
  color: seagreen;
`;

const Page = (props) => (
  <React.Fragment>
    <Meta />
    <Header />
    {props.children}
  </React.Fragment>
);

export default Page;
